import React,{ Component} from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import Init from './Init';
import Home from './home';
import SignUp from './signup.component';
import LineChart from './views/line charts/Line Chart';
import RangeBarChart from './views/column charts/Range Bar Chart';
import VoltageChart from './views/line charts/VoltageChart';
import LPDT from './views/Load profile table/LPDT';
import Events from './views/Events/Events';

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      loggedInStatus: false
    }
    this.handleLogin = this.handleLogin.bind(this);
    this.handleLogout = this.handleLogout.bind(this);
  }

  handleLogout() {
    //console.log("Inside handleLogout");
    this.setState({
      loggedInStatus: false,
      user: {}
    });
  }

  handleLogin(data) {
    this.setState({
      loggedInStatus: true,
      user: data
    }); 
  }


  componentWillUnmount(){

  }
  render() {    
    return (
      <div className="App">
        <Router basename={process.env.REACT_APP_ROUTER_BASE || ''}>
          <Switch>
            <Route exact path={"/navigation"}
              render={props => (
                <Init
                  {...props}
                  handleLogin={this.handleLogin}
                  handleLogout={this.handleLogout}
                  loggedInStatus={this.state.loggedInStatus}
                />
              )}
            />
            <Route exact path={"/home"}
              render={props => (
                <Home
                  {...props}
                  loggedInStatus={this.state.loggedInStatus}
                  handleLogout = {this.handleLogout}
                />
              )}
            />

`           <Route exact path={"/signup"}
              render={props => (
                <SignUp
                  {...props}
                />
              )}
            />

            <Route exact path={"/topology"}
              render={props => (
                <RangeBarChart/>
              )}
            />


            <Route exact path={"/energybalance"}
              render={props => (
                <LineChart/>
              )}
            />

            <Route exact path={"/voltage"}
              render={props => (
                <VoltageChart/>
              )}
            />


            <Route exact path={"/loadprofile"}
              render={props => (
                <LPDT/>
              )}
            />

            <Route exact path={"/events"} 
              render={props=>(
                <Events/>
              )}
            />

          </Switch>

        </Router>
      </div>

      );
  }
}

export default App;
